import React, { useState, useEffect } from "react";
import "./App.css";

// Pages
import { Login } from "./pages/Login";
import { Todo } from "./pages/Todo";
// Router
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Route component={Todo} path="/" exact />
    </Router>
  );
}

export default App;
